import React from "react";
import "../Components/style/signin.css";

function Signin() {
  return (
    <div className="m">
      <a href="#openModal">Sign In</a>

      <div id="openModal" class="modalDialog">
        <div>
          <a href="#close" title="Close" class="close">
            X
          </a>
          <h2>Sign In</h2>
          <p>
            This is a sample modal box that can be created using the powers of
            CSS3.
          </p>
          <p>
            You could do a lot of things here like have a pop-up ad that shows
            when your website loads, or create a login/register form for users.
          </p>
        </div>
      </div>
    </div>
  );
}

export default Signin;
